import React from "react";
import { Grid } from "@mui/material";

function navbar(){
    return (
        <div>
            <Grid container>
                <Grid item xs={6}>
                    <img style={{width: "30px"}} src={linkedin}/>
                    <img style={{width: "30px"}} src={loupe}/>
                </Grid>
                <Grid item xs={6}>
                    <img style={{width: "30px"}} src={home}/>
                    <img style={{width: "30px"}} src={reseau}/>
                </Grid>

            </Grid>
        </div>
    )
}

export default navbar;
